<blockquote><p class='quotation'><b><br><span style='font-size:25px'>Why use Splice Machine ML</span></b><br><br>Splice Machine ML isn't just a machine learning platform, it is much more than that. In fact, it is a complete machine learning lifecycle management solution, giving you total control of your models, from retrieving data to scalable deployment. Here are just a couple of advantages that we have over other platforms.<br><br><ol><li> Machine learning takes place on the incredibly powerful Apache Spark executors in your database, allowing you to complete massive jobs in parallel</li><li>When using the Splice Machine Python Package, the PySpliceContext, Spark will have direct access to your large amount of data, reducing time that would be spent transferring billions of rows over JDBC</li><li>An important part of data science is visualizing your data to find trends even before you feed it into an algorithm. Thanks to our handy Zeppelin notebooks, that can take place with one line of SQL code</li><li>After a data scientist has created a model, we need to tweak our model's parameters (preprocessing, hyperparameters, data source tc.), in the aim of coming up with the best model. However, there is no good way to keep track of all of these tiny changes. Our solution is a platform called MLFlow, which allows you to version runs and compare them to each other.<li>After you have found the best model for your task, you are ready to deploy it and use it in your applications. We allow you to push your MLFlow models up to scalable cloud computing services, such as AWS SageMaker and AzureML, to make predictions in real time.</li></ol><br>Feeling overwhelmed? Don't worry, we are going to guide you through this process.<br></p><footer>Your friends at Splice Machine</footer></blockquote>

