<blockquote><p class='quotation'><b><br><span style='font-size:25px'>Zeppelin</span></b><br><br>Zeppelin notebooks are a simple, easy and intuitive way to do data science, right in your browser. It is fast because any Spark computations you run inside of the notebook are executed right on your cluster's Spark executors.<br><br> As if speed wasn't enough, Zeppelin notebooks also make machine learning easier. By using Zeppelin intepreters, you can run different languages inside the same notebook. The language you want to run is signified by a % sign followed by an interpreter name at the top of a cell. For example, two of the interpreters you will become very familiar with while using our platform are the %pyspark and %splicemachine interpreters. In the %splicemachine interpreter, using a simple SQL SELECT query, you can easily generate beautiful graphs that show you trends in your data, even before you import it into pyspark.<br> <br><i>This entire demo was written inside a Zeppelin notebook</i></br><footer>-Your friends at Splice Machine</footer></blockquote><br>
<blockquote><p class='quotation'><b><br><span style='font-size:25px'>MLFlow</span></b><br><br>As a data scientist, you are constantly tweaking parameters, in the hopes of achieving the best possible model. The issue with that, is that it is very difficult to keep track of what you are changing-- even increasing a parameter by one can improve your model dramatically. MLFlow is a solution to this problem. <br><br> MLFlow has two main concepts: experiments and runs. Each time you run a model, MLFlow will generate a new run, which you can keep track of in the MLFlow tracking UI. The markers that you write in your code will be visible in the UI, so you can easily compare runs to each other. Because a new run is logged each time you create a model, <i><b>we highly reccomend that you only add markers after your model runs successfully.</b></i>.<br><br>You can think of experiments like folders for your models. For example, if you are an ecommerce company, you might have an experiment for predicting how late a shipment will be, and another for predicting which customer is the most likely to buy a certain item. <footer>-Your friends at Splice Machine</footer></blockquote>

